        position: absolute;
        left: 0;
        top: 0;
        border-radius: 30px;
      }
    }
  }
}

.navBar {
  &__menu {
    display: flex;
    flex-direction: column;
    position: fixed;
    top: 20%;
    transform: translateY(-50%);
    padding-left: 10px;
